    <HomePageContainer>
        <profiler id='Directory' onRender={(id, phase, actualDuration) => {
            console.log({
                id,
                phase,
                actualDuration
            });

        }}>
            <Directory />
        </profiler>
    </HomePageContainer>
);

export default HomePage;
